import React, { Component } from 'react';
import ProductItem from './ProductItem';

class Products extends Component {
  constructor(props) {
    super(props);

    this.state = {
      items: [
        {
          id: '1a',
          name: 'Sony',
        },
        {
          id: '2b',
          name: 'Samsung',
        },
        {
          id: '3c',
          name: 'Apple',
        },
      ],
    };
  }

  orderProducts = (_) => {};

  render() {
    return (
      <div>
        {this.state.items.map((item, index) => (
          <ProductItem product={item} key={index} />
        ))}
      </div>
    );
  }
}

export default Products;
